import './Projetos.css'


export default function Projeto() {
    return (
        <section className="presentation">
            <div className="presentation__container">
                <h1 className="presentation__title" title="Apresentação">Projetos</h1>
                <div></div>
                </div>
           
        </section>
    )
}
